Ext.data.JsonP['ACS_2013_11_March_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 2013 11 March Release Note</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-50725360\" class=\"content\">\n                        <h1>ACS 2013 11 March Release Note</h1>\n    <p>Added support for iOS Newsstand <tt class=\" \">content-available</tt>    <span style=\"color: #333333;\">\n flag in push notifications. Setting     </span>\n<tt class=\" \">content-available: 1</tt>    <span style=\"color: #333333;\">\n in the payload of a push notification identifies it as a Newsstand push notification used to initiate background download. Note that this feature is only supported by Newsstand apps. For more information, see the     </span>\n<a class=\"external-link external-link\" href=\"http://developer.apple.com/library/ios/#technotes/tn2280/_index.html\" target=\"_blank\">Apple Newsstand FAQ</a>    <span style=\"color: #333333;\">\n on the iOS Developer Center.    </span>\n    </p>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725360\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 11 March Release Note"});